Dutch:
Het elfjarige voetbaltalent Brandon wordt door zijn teamgenoot Sean valselijk beschuldigd van valsspelen. Hierop zet teamsponsor Fielding McArthur, Seans vader, hem uit het elftal en mag hij niet meespelen tijdens het aankomende internationale voetbaltoernooi. Als Brandon ontdekt dat er twee schurken actief zijn op het toernooi, probeert hij samen met zijn trouwe hond Rex, die tevens de mascotte van het team is, en de andere internationale hondenmascottes de schurken te ontmaskeren en zijn goede naam te herstellen.

English:
A ragtag gang of international talking-dog mascots must save the day and foil the plot of villains planning to sabotage the Youth World Cup soccer finals.

